features.script:
let closed = true

feature.on('click',e=>{

  if(closed){
      feature.position.x=9.13
    feature.position.y=7.65
  }else{
     feature.position.x=9.6
    feature.position.y=8.25     
  }
closed=!closed
})

setInterval(() => {
  let p = parcel.getPlayers()[0]

  if (!p) {
    return
  }

  let v1 = feature.position
  let v2 = p.position
  let angle = Math.atan2(v1.z - v2.z, v1.x - v2.x)

  feature.rotation.y = Math.PI / -2 - angle
}, 200)

feature.on('click',e=>{
  e.player.emote(emojis[20])
  // or any emojis within the array of emojis
})

